import React, { Component } from 'react';

class NewsRelated extends Component {
    render() {
        return (
            <div className="col-3">
                <div className="card-deck">
                    <div className="card">
                        <a href={"chitiet/"}><img className="card-img-top" src={this.props.anh} alt="true" /></a>
                        <div className="card-body">
                            <h4 className="card-title">{this.props.tieuDe}</h4>
                            <p className="card-text">{this.props.noiDung}</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default NewsRelated;
